import React from "react";
import { Link } from "react-router-dom";
import { Col, Row, Button, Container } from "reactstrap";
import "./Thankyou.css";
// import Newsletter from "../components/Shared/Newsletter";
// import Booking from "../components/Booking/Booking";
import './Mybooking.css';

const Mybooking = (props) => {
  const { booking } = props;

    
  return (
    <>
    <div>
   
      <div className="card" style={{ width: "18rem", margin: "0px 0px 45px" }}>
        {/* <img src={!imageurl? "https://i.ytimg.com/vi/87ORsmVj29Y/maxresdefault.jpg" : imageurl}
          className="card-img-top"
          alt="..."/> */}
          <img srcSet="https://wallpaperaccess.com/full/41839.jpg" alt="" srcset="" />
        <div className="card-body">
          <h5 className="card-title">Title </h5>
          <p className="card-text">description</p>
          <p className="card-text">
            <small className="text-muted">
              {" "}
              By Author 
              {/* {!author ? "Unknown" : author} */}
               on{" "}
              {new Date().toGMTString()}{" "}
            </small>
          </p>
          <a  target="_blank" className="btn btm-sm btn-dark">
            Read More
          </a>
        </div>
      </div>
    </div>
    </>
  );
};

export default Mybooking;
